function Mower(props) {
  return (
    <svg class="mower" xmlns="http://www.w3.org/2000/svg" transform="rotate(180)" width="12" height="12" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="feather feather-arrow-down"><line x1="12" y1="5" x2="12" y2="19"></line><polyline points="19 12 12 19 5 12"></polyline></svg>
  );
}

export default Mower
